// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "./Token.sol";

contract BuyInvoicesMainAPp {
    string public name = "EthSwap Fairtrader Main APp Testing";
    Token public token;
    //
    mapping(address => uint256) public stakes;

    address[] public stakers;
    Stakeholder[] public stakeholders;

    // event SmartContractOpenedBuyer(
    //     uint32 _id,
    //     string _termsAndCondition,
    //     string _warrantyFile,
    //     uint32 _apealTime,
    //     string _sellerWalletAddress,
    //     string _invoiceFile,
    //     string _customerEmail,
    //     uint32 _mediatorId,
    //     bool _medAccepted,
    //     string _friendsEmail
    // );
    // event ContractCompletedSeller(
    //     address indexed user,
    //     uint256 userIndex,
    //     address sellerOrUser
    // );

    struct OrderData {
        uint32 _orderId;
        uint256 _amount;
        string _termsAndCondition;
        string _warrantyFile;
        uint32 _apealTime;
        string _sellerWalletAddress;
        string _invoiceFile;
        string _customerEmail;
        uint32 _mediatorId;
        bool _medAccepted;
        string _judgeReport;
        string _judgeReportFile;
        uint32 _buyerTakeAmountInPercent;
        string _friendsEmail;
    }

    struct Stakeholder {
        address user;
        OrderData[] address_stakes;
    }

    constructor(Token _token) public {
        // constructor() public {
        stakeholders.push();
        token = _token;
    }

    function getBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function exchangeHistoryOfStake()
        external
        view
        returns (Stakeholder[] memory)
    {
        return stakeholders;
    }

    function getAllOrdersOfOneUser(address _userAddress)
        external
        view
        returns (OrderData[] memory)
    {
        // require(/* mediator is calling not any other person for security purpose*/);
        uint256 index = stakes[_userAddress];
        return stakeholders[index].address_stakes;
    }

    function medAcceptNewCases(uint32 _orderId, address buyerWalletAddress)
        external
        returns (OrderData[] memory)
    {
        // require(/* mediator is calling not any other person for security purpose*/);
        uint256 index = stakes[buyerWalletAddress];
        stakeholders[index].address_stakes[_orderId]._medAccepted = true;

        return stakeholders[index].address_stakes;
    }

     function medJudgeCaseReport(string memory _judgeReport, string memory _judgeReportFile, address buyerWalletAddress, address sellerWalletAddress, uint32 _orderId, uint32 _buyerTakeAmountInPercent)
        external
        returns (OrderData[] memory)
    {
        // require(/* mediator is calling not any other person for security purpose*/);
        uint256 index = stakes[buyerWalletAddress];
        stakeholders[index].address_stakes[_orderId]._judgeReport = _judgeReport;
        stakeholders[index].address_stakes[_orderId]._judgeReportFile = _judgeReportFile;
        stakeholders[index].address_stakes[_orderId]._buyerTakeAmountInPercent = _buyerTakeAmountInPercent;

        uint amount =  stakeholders[index].address_stakes[_orderId]._amount;
        uint buyerTakeAmountInPercent = stakeholders[index].address_stakes[_orderId]._buyerTakeAmountInPercent;

        // ADDING CHECK THAT ONLY SELLER ADDRESS IS SAME IN CONTRACT OR SOMEOEN ELSE IS TRYING
        // string memory sellerAddress = stakeholders[index].address_stakes[_orderId]._sellerWalletAddress;
        // require(string(sellerWalletAddress) == sellerAddress);

        if (buyerTakeAmountInPercent == 100) {
            payable(buyerWalletAddress).transfer(amount);

        } else if(buyerTakeAmountInPercent == 50) {
            payable(buyerWalletAddress).transfer(amount / 2);
            payable(sellerWalletAddress).transfer(amount / 2);
        } else {
            uint256 sellerTakePercent = 100 - buyerTakeAmountInPercent;
            payable(buyerWalletAddress).transfer(amount * buyerTakeAmountInPercent / 100);
            payable(sellerWalletAddress).transfer(amount * sellerTakePercent / 100);
        }

        return stakeholders[index].address_stakes;
    }

    function _addStakeholder(address staker) internal returns (uint256) {
        stakeholders.push();
        uint256 userIndex = stakeholders.length - 1;
        stakeholders[userIndex].user = staker;
        stakes[staker] = userIndex;
        return userIndex;
    }

    function _saveOrdersDataOfUser(
        uint32 _orderId,
        uint256 _amount,
        string memory _termsAndCondition,
        string memory _warrantyFile,
        uint32 _apealTime,
        string memory _sellerWalletAddress,
        string memory _invoiceFile,
        string memory _customerEmail,
        uint32 _mediatorId,
        bool _medAccepted,
        string memory _friendsEmail
    ) public {
        // Check that the requested amount of tokens to sell is more than 0
        // require(_sellerWalletAddress == '', "seller Wallet Address Cannot nothing");

        uint256 index = stakes[msg.sender];
        if (index == 0) {
            index = _addStakeholder(msg.sender);
        }

        stakeholders[index].address_stakes.push(
            OrderData(
                _orderId,
                _amount,
                _termsAndCondition,
                _warrantyFile,
                _apealTime,
                _sellerWalletAddress,
                _invoiceFile,
                _customerEmail,
                _mediatorId,
                _medAccepted,
                "",
                "",
                0,
                _friendsEmail
            )
        );
    }

    function buyWithFTP(
        uint32 _orderId,
        uint256 _amount,
        string memory _termsAndCondition,
        string memory _warrantyFile,
        uint32 _apealTime,
        string memory _sellerWalletAddress,
        string memory _invoiceFile,
        string memory _customerEmail,
        uint32 _mediatorId,
        bool _medAccepted,
        string memory _friendsEmail
    ) public {
        // User can't sell more tokens than they have
        require(token.balanceOf(msg.sender) >= _amount);

        // Perform sale
        token.transferFrom(msg.sender, address(this), _amount);

        _saveOrdersDataOfUser(
            _orderId,
            _amount,
            _termsAndCondition,
            _warrantyFile,
            _apealTime,
            _sellerWalletAddress,
            _invoiceFile,
            _customerEmail,
            _mediatorId,
            _medAccepted,
            _friendsEmail
        );
    }

    // function buyWithUsdt(
    //     uint32 _orderId,
    //     uint256 _amount,
    //     string memory _termsAndCondition,
    //     string memory _warrantyFile,
    //     uint32 _apealTime,
    //     string memory _sellerWalletAddress,
    //     string memory _invoiceFile,
    //     string memory _customerEmail,
    // uint32 _mediatorId,
    // bool _medAccepted,
    //     string memory _friendsEmail
    // ) public {
    //     // User can't sell more tokens than they have
    //     require(usdtToken.balanceOf(msg.sender) >= _amount);

    //     // Perform sale
    //     usdtToken.transferFrom(msg.sender, address(this), _amount);

    //     _saveOrdersDataOfUser(
    //         _orderId,
    //          _amount,
    //         _termsAndCondition,
    //         _warrantyFile,
    //         _apealTime,
    //         _sellerWalletAddress,
    //         _invoiceFile,
    //         _customerEmail,
    // _mediatorId,
    // _medAccepted,
    //         _friendsEmail
    //     );
    // }

    function buyWithBNB(
        uint32 _orderId,
        string memory _termsAndCondition,
        string memory _warrantyFile,
        uint32 _apealTime,
        string memory _sellerWalletAddress,
        string memory _invoiceFile,
        string memory _customerEmail,
        uint32 _mediatorId,
        bool _medAccepted,
        string memory _friendsEmail
    ) public payable {
        // User can't sell more tokens than they have
        // require(token.balanceOf(msg.sender) >= msg.value);

        // Perform sale
        // token.transferFrom(msg.sender, address(this), _amount);
        // address(address(this).transfer(_amount));
        // token.transfer(address(this), _amount);
        // token.transferFrom(msg.sender, address(this), _amount);

        _saveOrdersDataOfUser(
            _orderId,
            msg.value,
            _termsAndCondition,
            _warrantyFile,
            _apealTime,
            _sellerWalletAddress,
            _invoiceFile,
            _customerEmail,
            _mediatorId,
            _medAccepted,
            _friendsEmail
        );
    }
}
